import React, { Component } from "react";
import { Link } from "react-router-dom";

const MainNav = () => {
  return (
    <header>
      <nav>
        <ul>
          <li>
            <Link to="all-quotes">All Quotes</Link>
          </li>
          <li>
            <Link to="new-quote">New Quote</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
};
export default MainNav;
